  false,\n\t\"url\": null,\n\t\"notes\": \"The DLG data files used to create this
  dataset are derived from the 1:2,000,000-scale maps contain selected base categories
  of cartographic data in digital form. The data files are derived from the sectional
  maps of the 1970 National Atlas of the United States of America. The Transportation
  category includes major transportation systems in three separate subcategories:
  (1) Roads and Trails, (2) Railroads, and (3) Cultural Features (Airports and Alaska
  Pipeline). This file contains only data pertaining to New York State.\",\n\t\"license_title\":
